import Expenseltem from "./components/Expenseltem";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Tuvalet Kağıdı",
      amount: 67.45,
      date: new Date(2022, 3, 15),
    },
    {
      id: "e2",
      title: "Manav Alışverişi",
      amount: 320,
      date: new Date(2022, 3, 15),
    },
    {
      id: "e3",
      title: "Xiaomi Tavan Lambası",
      amount: 2800,
      date: new Date(2022, 3, 15),
    },
    {
      id: "e4",
      title: "Philips Hue",
      amount: 1400,
      date: new Date(2022, 3, 15),
    },
    {
      id: "e5",
      title: "Gigabyte Monitör",
      amount: 5200,
      date: new Date(2022, 3, 15),
    },
  ];

  const paragraf = document.createElement("p");
  paragraf.innerHTML = "Cem Hocanın Aq";
  document.getElementById("root").append(paragraf);
  return (
    <div>
      <Expenseltem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      />
      <Expenseltem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      />
      <Expenseltem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      />
      <Expenseltem
        title={expenses[3].title}
        amount={expenses[3].amount}
        date={expenses[3].date}
      />
      <Expenseltem
        title={expenses[4].title}
        amount={expenses[4].amount}
        date={expenses[4].date}
      />
    </div>
  );
}

export default App;
